const app=require('./page-object/App');
const base=require('./page-object/Base')

describe('Open the url', () => {
    it('should open the link ', () => {
        app.openHomepage();
        base.pauseShort();
    });

    it('should click on Cookie Settings button and verify the page', ()=> {
      const ButtonDisplay= $('/html/body/div[1]/div[2]/div[4]/div[3]/div/button');
      ButtonDisplay.waitForExist();
      expect(ButtonDisplay).toBeDisplayed();
      base.pauseShort();
      ButtonDisplay.click();
      const privacyCentre= $('#optanon-popup-body-right > p');
      privacyCentre.waitForExist();
      expect(privacyCentre).toHaveText('Privacy Preference Centre');
    });

   it('should allow privacy Setting', () => {
        const allowSetting= $('//*[@id="optanon-popup-bottom"]/div[2]/div[2]/button');
        allowSetting.waitForExist();
        base.pauseShort();
        allowSetting.click();
        expect(browser).toHaveTitle('A million more | Volvo Cars');
        base.pauseShort();
     });

    it('should open right side Navigation Item ', () => {
        const NavIcon=$('//*[@id="site-nav-topbar-wrapper"]/nav/div[3]/button/div');
        NavIcon.waitForExist();
        NavIcon.click();
        base.pauseShort();
      
    });
    it('should close navigation panel', () => {
        const closeNavIcon= $('/html/body/div[6]/div/nav/div[2]/div[2]/button/div/span');
        closeNavIcon.waitForExist();
        closeNavIcon.click();
        base.pauseShort();
    });
    
    it('should click cars navigation button ', () => {
        const CarNav=$('//*[@id="site-nav-topbar-wrapper"]/nav/button');
        CarNav.waitForExist();
        CarNav.click();
        base.pauseShort();
        
    });

    it('should close cars navigation panel', () => {
        const closeNav=$('//*[@id="vcc-site-nav"]/div/div[4]/div/button');
        closeNav.click();
        base.pauseShort();
    });
});

